                  "get()": "if (this.lfv_brandmeldinstallatie.bestuurbaar == ja && this.lfv_brandmeldinstallatie.storingen == {})\n{\nreturn beschikbaar;\n}\nif (this.lfv_brandmeldinstallatie.bestuurbaar == nee || this.lfv_brandmeldinstallatie.storingen[i] == STORING_INTERNE_VERBINDING)\n{\nreturn niet_beschikbaar;\n}\nreturn beperkt_beschikbaar;\n",
                  "st()": "IF Brandmeldinstallatie%d_lfv_brandmeldinstallatie_bestuurbaar = ja  AND  Brandmeldinstallatie%d_lfv_brandmeldinstallatie_storingen = {} THEN\nBrandmeldinstallatie%d_Beschikbaarheid := beschikbaar;\nELSE IF Brandmeldinstallatie%d_lfv_brandmeldinstallatie_bestuurbaar = nee  OR  Brandmeldinstallatie%d_lfv_brandmeldinstallatie_storingen[i] = STORING_INTERNE_VERBINDING THEN\nBrandmeldinstallatie%d_Beschikbaarheid := niet_beschikbaar;\nELSE Brandmeldinstallatie%d_Beschikbaarheid := beperkt_beschikbaar;\nEND_IF;"
