                  "st()": "IF CCTV%d_schouwOplopend = 1 THEN\nIF CCTV%d_schouwcamera_index ≤ (lengte(_schouwlijst) - lengte(_sf_schouwkanalen)) THEN CCTV%d_schouwcamera_index := CCTV%d_schouwcamera_index + lengte(_sf_schouwkanalen);\nToonEnPrefetchSchouwkanalen();\nEND_IF;\nEND_IF;"
