                  summary: "OntkoppelCamera",
                  description: "Stop het vertonen van actueel beeld (zodat ander actueel beeld of opgenomen beelden vertoond kunnen worden). Parameter aanvragen geeft aan of er een UKVC connectieverzoek gedaan moet worden om zwart beeld te tonen OP dit kanaal (mogelijk wordt het beeld vervangen, dan is zwart beeld niet nodig).",
