                  "js()": "if (this.camera != geen)\n{\nIF (this.camera.lfv_camera.bestuurbaar = ja) THEN this.camera.lfv_camera.UnselectCameraActueelBeeld(this.kanaal_id) END_IF SetCameraGetoond(verbergen, aanvragen) this.camera = geen;\n}\n",
                  "st()": "IF CCTV%d_ontkoppelCamera(aanvragen) = 1 THEN\nIF CCTV%d_camera <> geen THEN\nIF (#camera_lfv_camera_bestuurbaar = ja) THEN CCTV%d_camera_lfv_camera.UnselectCameraActueelBeeld(_kanaal_id) END_IF SetCameraGetoond(verbergen, aanvragen) CCTV%d_camera := geen;\nEND_IF;\nEND_IF;"
