                "setCameraGetoond(status)": {
                  stereotype: "besturing",
                  summary: "SetCameraGetoond",
                  description: "Parameter status geeft aan hoe OP de camera de administratie van de lijst met kanalen bijgewerkt moet worden. Parameter aanvragen geeft aan of er via UKVC8 nog een connectieverzoek gedaan moet worden: bij status tonen of voorbereiden wordt gevraagd verbinding te maken met de huidige camera van dit kanaal; bij status verbergen kan dit kanaal OP zwart gaan.",
                  bsttiName: "SetCameraGetoond",
                  bsttiNr: "BSTTI#18447",
                  bsttiPath: [
                    "Functies van een Verkeersbuis",
                    "CCTV-functies",
                    "CCTV",
                    "Besturingen"
                  ],
                  parameters: [
                    {
                      name: "id",
                      in: "query",
                      description: "Identifier of CCTV",
                      required: true,
                      schema: {
                        type: "number"
                      }
                    },
                    {
                      name: "status",
                      in: "query",
                      description: "status",
                      required: true,
                      schema: {
                        type: "string"
                      }
                    }
                  ],
                  operationId: "CCTV(id).setCameraGetoond(status)",
                  rules: [
                    {
                      Conditie: "#camera <> geen",
                      Acties: "IF (status = tonen) THEN  #camera.setGetoondOpKanaal(_kanaal_id, ja)  ELSE  #camera.setGetoondOpKanaal(_kanaal_id, nee)  END_IF   IF (aanvragen = ja) && (status = (tonen | voorbereiden)) THEN $ukvc8_vraagVideoConnectie( _kanaal_id, #camera._lfv_camera._ptz_interface, #camera._lfv_camera._video_interface, _kanaaltype, camera) ELSIF (aanvragen = ja) && (status = verbergen) THEN $ukvc8_vraagVideoConnectie( _kanaal_id, geen, geen, _kanaaltype, camera) END_IF"
                    }
                  ],
                  "js()": "if (this.camera != geen)\n{\nIF (status = tonen) THEN;\nthis.camera.setGetoondOpKanaal(this.kanaal_id, ja);\nELSE;\nthis.camera.setGetoondOpKanaal(this.kanaal_id, nee);\nEND_IF;\n IF (aanvragen = ja) && (status = (tonen | voorbereiden)) THEN $ukvc8_vraagVideoConnectie( this.kanaal_id, this.camera.lfv_camera.ptz_interface, this.camera.lfv_camera.video_interface, this.kanaaltype, camera) ELSIF (aanvragen = ja) && (status = verbergen) THEN $ukvc8_vraagVideoConnectie( this.kanaal_id, geen, geen, this.kanaaltype, camera) END_IF;\n}\n",
                  "st()": "IF CCTV%d_setCameraGetoond(status) = 1 THEN\nIF CCTV%d_camera <> geen THEN\nIF (status = tonen) THEN; CCTV%d_camera.setGetoondOpKanaal(_kanaal_id, ja);\nELSE; CCTV%d_camera.setGetoondOpKanaal(_kanaal_id, nee);\nEND_IF;\nIF (aanvragen = ja)  AND  (status = (tonen | voorbereiden)) THEN $ukvc8_vraagVideoConnectie( CCTV%d_kanaal_id, CCTV%d_camera_lfv_camera_ptz_interface, CCTV%d_camera_lfv_camera_video_interface, CCTV%d_kanaaltype, camera) ELSIF (aanvragen = ja)  AND  (status = verbergen) THEN $ukvc8_vraagVideoConnectie( CCTV%d_kanaal_id, geen, geen, CCTV%d_kanaaltype, camera) END_IF;\nEND_IF;\nEND_IF;"
                },
