                  "get()": "if (this.lfv_rvv.bestuurbaar== ja &&;\nthis.lfv_rvv.storingen == {} && this.transitiestatus_vergrendeling != niet_bereikt)\n{\nreturn beschikbaar;\n}\nif (this.lfv_rvv.bestuurbaar== nee || this.transitiestatus_vergrendeling == niet_bereikt)\n{\nreturn niet_beschikbaar;\n}\nreturn beperkt_beschikbaar;\n",
