                  "js()": "if (this.conditiewaarde == ja && (this.type == verkeerskundig_alarm || this.type == deelsysteem_alarm) && this.in_monitorlijst_alarmen == nee && this.camera_koppeling == ja)\n{\nthis.bf_cctv.VoegToeAanMonitorlijst(alarmen, na_einde, this.sf_camera, this.preset) this.in_monitorlijst_alarmen = ja;\n}\nif (this.conditiewaarde == nee && this.in_monitorlijst_alarmen == ja)\n{\nthis.bf_cctv.VerwijderCameraEnPresetsUitMonitorlijst(alarmen, this.sf_camera, this.preset) this.in_monitorlijst_alarmen = nee;\n}\n",
                  "st()": "IF Signaleringen%d_bewaakAlarmenMonitorlijst = 1 THEN\nIF Signaleringen%d_conditiewaarde = ja  AND  (_type = verkeerskundig_alarm  OR  Signaleringen%d_type = deelsysteem_alarm)  AND  Signaleringen%d_in_monitorlijst_alarmen = nee  AND  Signaleringen%d_camera_koppeling = ja THEN Signaleringen%d_bf_cctv.VoegToeAanMonitorlijst(alarmen, na_einde, Signaleringen%d_sf_camera, Signaleringen%d_preset) Signaleringen%d_in_monitorlijst_alarmen := ja;\nELSE IF Signaleringen%d_conditiewaarde = nee  AND  Signaleringen%d_in_monitorlijst_alarmen = ja THEN Signaleringen%d_bf_cctv.VerwijderCameraEnPresetsUitMonitorlijst(alarmen, Signaleringen%d_sf_camera, Signaleringen%d_preset) Signaleringen%d_in_monitorlijst_alarmen := nee;\nEND_IF;\nEND_IF;"
