                  "js()": "if (this.conditiewaarde is zojuist veranderd van nee naar ja &&;\nthis.onderdrukt == nee)\n{\n$ukvc6_AlarmNotificatie(this.naam, this.type, Actief, this.instantie_id);\n}\nif (this.conditiewaarde == ja &&;\n(this.onderdrukt is zojuist veranderd van ja naar nee))\n{\n$ukvc6_AlarmNotificatie(this.naam, this.type, Actief, this.instantie_id);\n}\n",
                  "st()": "IF Signaleringen%d_meldenAlarm = 1 THEN\nIF Signaleringen%d_conditiewaarde is zojuist veranderd van nee naar ja  AND   Signaleringen%d_onderdrukt = nee THEN\n$ukvc6_AlarmNotificatie(_naam, Signaleringen%d_type, Actief, Signaleringen%d_instantie_id);\nELSE IF Signaleringen%d_conditiewaarde = ja  AND   (#onderdrukt is zojuist veranderd van ja naar nee) THEN\n$ukvc6_AlarmNotificatie(_naam, Signaleringen%d_type, Actief, Signaleringen%d_instantie_id);\nEND_IF;\nEND_IF;"
