                  "st()": "IF Signaleringen%d_afmeldenAlarm = 1 THEN\nIF Signaleringen%d_conditiewaarde = ja  AND   (#bevestigd is zojuist veranderd van nee naar ja)  AND   Signaleringen%d_onderdrukt = nee THEN\n$ukvc6_AlarmNotificatie(_naam, Signaleringen%d_type, Inactief, Signaleringen%d_instantie_id);\nELSE IF Signaleringen%d_conditiewaarde = ja  AND   Signaleringen%d_bevestigd = nee  AND   (#onderdrukt is zojuist veranderd van nee naar ja) THEN\n$ukvc6_AlarmNotificatie(_naam, Signaleringen%d_type, Inactief, Signaleringen%d_instantie_id);\nELSE IF (#conditiewaarde is zojuist veranderd van ja naar nee)  AND   Signaleringen%d_bevestigd = nee  AND   Signaleringen%d_onderdrukt = nee THEN\n$ukvc6_AlarmNotificatie(_naam, Signaleringen%d_type, Inactief, Signaleringen%d_instantie_id);\nEND_IF;\nEND_IF;"
