                  "st()": "IF Twee-Buis_State_Controle%d_bewaakBuisRelatieOnderhoudHerstel = 1 THEN\nIF \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Twee-Buis_State_Controle%d_substate = ( onderhoud_herstel  THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n    THEN\n\"j (j <> i  AND  Twee-Buis_State_Controle%d_cf_verkeersbuis[j]_substate = calamiteit_ondersteunend : Twee-Buis_State_Controle%d_cf_verkeersbuis[j].OnderhoudHerstelNaCalamiteit());\nEND_IF;\nEND_IF;"
