                  description: "{ Tunneloperator bedienen, Tunneloperator inzien, Technisch beheerder TTI, Operationeel beheerder TTI} De taakcontext als gebruikt bij het registreren van een bedientaak, de indices relateren naar een taak beschrijving van het type TaakContext van ref. [UKVC8_IRS].   Deze lijst moet worden uitgebreid als er meer taakcontexten (GUIs) moeten zijn; bijvoorbeeld to_inzien2 bij een tweede inzien taak overeenkomend met Tunneloperator 2e inzien; of to_actief_li en to_actief_re bij taaksplitsing in linker en rechter deel overeenkomend met resp. Tunneloperator Links bedienen en Tunneloperator Rechts bedienen. De indices dienen overeen te komen met de indices uit BSTTI#18704.",
