                  stereotype: "variabele",
                  type: "array",
                  summary: "#bedientaken[]",
                  description: "Een dynamische lijst met gegevens van de bedientaken die zich geregistreerd hebben. Er kunnen geen tot meerdere bedientaken geregistreerd zijn: 0n. Per bedientaak, krijgen de elementen taakcontext, taakInfo, en sessiekey de waarde als meegegeven bij transactie startTaakregistratie (BSTTI#19054). De sessiekey is uniek.   Toelichting OP de elementen:   taakcontext: volgens type TaakContext van ref. [UKVC8_IRS], bevat informatie over de bedieningsview die gevraagd wordt: overeenkomend met n van de mogelijke profielen met de bijbehorende rechten en functionaliteiten (zie o.a. ref. [BOMMI], BOMMI#3861 en BOMMI#3865); en ook links, rechts, totaal (zodra het concept taaksplitsing gemplementeerd is). Zie ook BSTTI#19047.   taak_id: de index overeenkomend met parameter taakcontext volgens BSTTI#19047. Wordt gebruikt om (makkelijker) naar de basisfunctie Bediening te refereren die correspondeert met de bedientaak met deze gegeven taakcontext.   taakInfo, volgens type T_TaakaansturingsInfo van ref. [UKVC8_IRS], bevat o.a. de elementen:  - alarmInterface: Dit koppelpunt moet, samen met parameter sessie_id, doorgegeven worden aan het besturingsdeel dat ukvc6 alarmen implementeert. Zie BSTTI#18788, $ukvc6_RegistrerenVoorAlarmNotificaties({alarmInterface, sessie_id}).  - controlInterface: Van de bedientaak die zich registreert, het koppelpunt voor de uitgaande UKVC8 transacties.  - requestTimeoutMs: de te hanteren timeout voor inkomende en de uitgaande transacties, geldend voor alle UKVC transacties binnen deze taak context (dus ook voor de andere pinnen). Zal doorgegeven moeten worden aan alle taken die UKVC implementatie verzorgen binnen deze taak context.  - aliveTimeoutMs: De timeout die gehanteerd moet worden binnen deze taak context voor de alive controle, van objectzijde naar bedienzijde. Zie ook transactie monitorTaak (BSTTI#19083).  - soortSessie: van belang voor de mogelijkheden die de bediening moet bieden (zie type SessieType in ref. [UKVC8_IRS]; voor tunnels wordt altijd bedienen verwacht).   sessiekey: volgens type T_TaakaansturingsInfo van ref. [UKVC8_IRS], bevat een unieke waarde (key). Inkomende transacties die horen bij de bedientaak zullen deze key meesturen. Hiermee is de relatie te leggen naar de bedientaak. De uitgaande transacties moeten deze ook weer meesturen om de relatie te leggen met de bedientaak.   sessieGestart: krijg bij transactie startTaakregistratie de waarde nee, bij transactie startSessie (BSTTI#19055) de waarde ja, en bij transactie beeindigTaakregistratie weer de waarde nee.   ",
