                  stereotype: "autonoom_proces",
                  summary: "*DoorgevenVideoVerzoek",
                  description: "Doorgeven van het verzoek van objectzijde (tunnel) naar bedienzijde, om een video-connectie te maken met n of meerdere videobronnen. Zolang de bedientaak nog niet gestart is, worden de verzoeken gebufferd.   Verzoek worden gestuurd naar de geregistreerde bedientaak met taakcontext Tunneloperator bedienen. (taakcontext: zie BSTTI#19047). In het verzoek kunnen meerdere verbindingen opgenomen zijn, ook per viewer_id. Alleen de laatste wordt dan doorgestuurd, het heeft bijvoorbeeld geen zin voor een viewer zwart beeld te vragen, en direct daarna voor diezelfde viewer verbinding met een camera te vragen. Het verzoek wordt daarna ook gestuurd naar de geregistreerde bedientaken met taakcontext Tunneloperator inzien. Om te voorkomen dat deze taken een camera gaan bedienen worden eerst de ptz_interfaces leeg gemaakt. Daarnaast worden verzoeken betreffende schouwkanalen ook niet naar deze taken gestuurd, omdat het zou kunnen interfereren met het schouwen van andere objecten (zelfde locatie OP de videowand).   Opmerking: Bij uitwerking het ontwerp te bepalen voor het voorkmen dat er nieuwe videoverzoeken aan de lijst worden toegevoegd tijdens doorgeven.",
