                  "js()": "if (this.cf_verkeersbuis.every(function(){return this.substate == ( onderhoud_herstel | onderhoud_regulier ) &&;\nthis.cf_veilige_ruimte.state != onderhoud;})\n{\nthis.cf_veilige_ruimte.NaarOnderhoud();\n}\nif (this.cf_verkeersbuis.some(function(){return this.substate == bedrijf_normaal && this.cf_verkeersbuis.every(function(){return this.substate == ( bedrijf_normaal | onderhoud_herstel | onderhoud_regulier ) &&;\nthis.cf_veilige_ruimte.state != normaal;};})\n{\nthis.cf_veilige_ruimte.NaarNormaal();\n}\nif (this.cf_verkeersbuis.some(function(){return this.substate == bedrijf_standby && ( this.cf_veilige_ruimte.state != vlucht_voorbereid || ( this.cf_veilige_ruimte. this.evacuatie_richting != tegenovergestelde( this.cf_verkeersbuis[i].rijrichting) && this.cf_verkeersbuis[3-i].substate != bedrijf_standby ));})\n{\nthis.cf_veilige_ruimte. NaarVluchtVoorbereid(tegenovergestelde(this.cf_verkeersbuis.some(function(){return this.rijrichting), i;});\n}\nif (this.cf_verkeersbuis.some(function(){return this.substate == calamiteit_volledig &&;\nthis.cf_veilige_ruimte.state != vlucht_gereed &&;\nthis.cf_veilige_ruimte.state != evacuatie;})\n{\nthis.cf_veilige_ruimte. NaarVluchtGereed(tegenovergestelde(this.cf_verkeersbuis.some(function(){return this.rijrichting), i;});\n}\nif (this.cf_verkeersbuis.some(function(){return this.substate == calamiteit_evacuatie &&;\nthis.cf_veilige_ruimte.state != evacuatie;})\n{\nIF this.cf_veilige_ruimte.state != vlucht_gereed THEN this.cf_veilige_ruimte. NaarVluchtGereed(tegenovergestelde(this.cf_verkeersbuis.some(function(){return this.rijrichting), i) END_IF this.cf_veilige_ruimte.NaarEvacuatie(;});\n}\n",
                  "st()": "IF Veilige_Ruimte_State_Controle%d_bewaakVeiligeRuimteVanuitVerkeersBuisSubStates = 1 THEN\nIF \r\n   result := true;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_substate = ( onderhoud_herstel | onderhoud_regulier  THEN\r\n   result := false;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n     AND   Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> onderhoud THEN Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte.NaarOnderhoud();\nELSE IF Veilige_Ruimte_State_Controle%d_cf_verkeersbuis[i]_substate = bedrijf_normaal  AND  \r\n   result := true;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_substate = ( bedrijf_normaal | onderhoud_herstel | onderhoud_regulier  THEN\r\n   result := false;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n     AND   Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> normaal THEN Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte.NaarNormaal();\nELSE IF \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_substate = bedrijf_standby  AND  ( Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> vlucht_voorbereid  OR  ( Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte. Veilige_Ruimte_State_Controle%d_evacuatie_richting <> tegenovergestelde( Veilige_Ruimte_State_Controle%d_cf_verkeersbuis[i]_rijrichting)  AND  Veilige_Ruimte_State_Controle%d_cf_verkeersbuis[3-i]_substate <> bedrijf_standby ) THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n    THEN Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte. \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_rijrichting), i THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n   ;\nELSE IF Veilige_Ruimte_State_Controle%d_cf_verkeersbuis[i]_substate = calamiteit_volledig  AND   Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> vlucht_gereed  AND   Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> evacuatie THEN Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte. \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_rijrichting), i THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n   ;\nELSE IF Veilige_Ruimte_State_Controle%d_cf_verkeersbuis[i]_substate = calamiteit_evacuatie  AND   Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> evacuatie THEN\nIF Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte_state <> vlucht_gereed THEN Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte. \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Veilige_Ruimte_State_Controle%d_rijrichting), i) END_IF Veilige_Ruimte_State_Controle%d_cf_veilige_ruimte.NaarEvacuatie( THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n   ;\nEND_IF;\nEND_IF;"
