                  "st()": "IF Vloeistofafvoersysteem%d_handhaafRegimes = 1 THEN\nIF Vloeistofafvoersysteem%d_state = normaal THEN\nNaarNormaal();\nELSE IF Vloeistofafvoersysteem%d_state = calamiteit THEN\nNaarCalamiteit();\nELSE IF Vloeistofafvoersysteem%d_state = uit THEN\nNaarUit();\nEND_IF;\nEND_IF;"
