                  summary: "*BewaakVloeistofafvoersysteemVanuitVerkeersbuisSubstates",
                  description: "Als ten minste n verkeersbuis in (sub)state calamiteit of onderhoud_herstel komt, moet het vloeistofafvoersysteem automatisch van state normaal naar calamiteit gaan. De auto bedieningswijze wordt afgedwongen ten gevolge van hoofdtoestandsovergang. Als geen van de verkeersbuizen in (sub)state calamiteit of onderhoud_herstel is, is de gewenste state voor het vloeistofafvoersysteem 'normaal'. Deze overgang wordt echter uitgesteld totdat wordt bevestigd (door de WVL) dat het vloeistofafvoersysteem veilig naar 'normaal' kan (zie NaarUitgesteldNormaalAuto).",
                  bsttiName: "*BewaakVloeistofafvoersysteemVanuitVerkeersbuisSubstates",
