                  "st()": "IF Vluchtdeurindicatie%d_herhaalGeluidsbakenBoodschap = 1 THEN\nIF \r\n   result := false;\r\n   FOR count := 0 TO i BY 1 DO\r\n   IF Vluchtdeurindicatie%d_status_geluidsbaken = aan  AND   Vluchtdeurindicatie%d_opgenomen_boodschap_id = ( geen | ongeldig  THEN\r\n   result := true;\r\n   EXIT;\r\n   END_IF;\r\n   END_FOR;\r\n    THEN\nSpeelOpgenomenBoodschap( Vluchtdeurindicatie%d_geluidsbaken_boodschap );\nEND_IF;\nEND_IF;"
