                  "js()": "if (this.bedieningswijze_geluidsbakens == auto && this.auto_stand_geluidsbakens == aan)\n{\nthis.sf_geluidsbaken.every(function(){return SetAutoStand(aan;});\n}\nif (this.bedieningswijze_geluidsbakens == hand || this.auto_stand_geluidsbakens == uit)\n{\nthis.sf_geluidsbaken.every(function(){return SetAutoStand(uit;});\n}\n",
